export default function Card() {
  return (
    <div class="w-full h-screen grid grid-cols-2 bg-lime-400">
      <img src="https://images.unsplash.com/photo-1558591710-4b4a1ae0f04d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=687&q=80" />
      <div class="flex flex-col justify-center px-14">
        <h2 class="font-Plex font-extrabold">Sustainable Investing</h2>
        <p>
          YFAC 2022 is about sustainability. How can we invest in the future of
          our planet? This year, participants will incorporate Environmental,
          Social, and Governance (ESG) perspectives into their investment
          analyses.
        </p>
      </div>
    </div>
  );
}
